import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import axios from 'axios';
import findLocalIp from '../../backend/src/utils/findLocalIp';

let backendAdress = `http://${findLocalIp()}:${config.port}`;

axios.get(backendAdress).then(res => {
  if (res.status === 200) {
    ReactDOM.render(<App />, document.getElementById('root'));
  }
})

axios.get()
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
